window.bookSummaryJSON = "From the national best-selling author - the new novel set in the \"darkly fascinating world\" (SF Site) of the Black Jewels. <p>Dena Nehele is a land decimated by its past. Once it was ruled by corrupt Queens who were wiped out when the land was cleansed of tainted Blood. Now, only 100 Warlord Princes stand - without a leader and without hope.</p> <p>Theran Grayhaven is the last of his line, desperate to find the key that reveals a treasure great enough to restore Dena Nehele. But first he needs to find a Queen who remembers the Blood's code of honor and lives by the Old Ways. The woman chosen to rule Dena Nehele, Lady Cassidy, is not beautiful and believes she is not strong. But she may be the only one able to convince bitter men to serve once again.</p>"; 
